import './App.css';
import './contenedores.css';
import BarraNavegacion from './BarraNavegacion';
import Contenedor from './Contenedor';
import Resultado from './resutado/resultado';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Seleccionarimg from './Seleccionimg';
import ImagenCargada from './resutado/ImagenCargada';

function App() {
  const [selectedImage, setSelectedImage] = useState(null);

  const handleImageSelect = (selectedFile) => {
    setSelectedImage(selectedFile);
  };
  return (
    <div className="App">
      <BrowserRouter>
        <BarraNavegacion/>
        <header className="App-header">
          <Routes>
              <Route path="/" element={<Contenedor/>}></Route> 
              <Route path="/resultado" element={<Resultado/>}></Route> 
          </Routes>
          </header>
      </BrowserRouter>
    </div>
  );
}

export default App;
